-- Keys (pregenerated)
DROP TABLE IF EXISTS warden_keys;
CREATE TABLE `warden_keys`  (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `module` int unsigned NOT NULL,
  `seed` text NOT NULL,
  `clientKey` text NOT NULL,
  `serverKey` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;


-- Modules
DROP TABLE IF EXISTS warden_modules;
CREATE TABLE `warden_modules` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `platform` int NOT NULL,
  `key` VARCHAR(32) NOT NULL,
  `module` BLOB,
  `memoryCheckCode` TINYINT UNSIGNED,
  `moduleCheckCode` TINYINT UNSIGNED,
  `aPageCheckCode` TINYINT UNSIGNED,
  `bPageCheckCode` TINYINT UNSIGNED,
  `driverCheckCode` TINYINT UNSIGNED,
  `luaStringCheckCode` TINYINT UNSIGNED,
  `luaExecCheckCode` TINYINT UNSIGNED,
  `filesystemCheckCode` TINYINT UNSIGNED,
  `procCheckCode` TINYINT UNSIGNED,
  `timingCheckCode` TINYINT UNSIGNED,
  `interopCheckCode` TINYINT UNSIGNED,
  `comment` VARCHAR(255),
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

